import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './index.css';
import { DarkModeProvider } from '../src/context/DarkModeContext.js';

ReactDOM.render(
  <DarkModeProvider>
    <App />,
    </DarkModeProvider>,
  document.getElementById('root')
);
